.JNPF-common-head {
  padding-top: 0px;
}
.JNPF-el_tabs {
  >>> .el-tabs__item {
    text-align: center;
  }
  >>> .el-tabs__content {
    padding: 15px 0 15px;
  }
}
.childrenTab {
  >>> .el-tabs__nav-scroll {
    margin-left: -15px;
  }
  >>> .el-tabs__item {
    width: 120px;
    text-align: right;
  }
  >>> .el-tabs__content {
    height: 100%;
    padding-top: 0px;
    .el-tab-pane {
      height: 100%;
    }
  }
}
.JNPF-dialog_fq >>> .el-dialog__body {
  height: 400px;
  overflow: scroll;
}
.user-list {
  width: 100%;

  .user-item {
    margin-bottom: 15px;
    .user-item-main {
      height: 70px;
      position: relative;
      border-radius: 4px;
      border: 1px solid #dcdfe6;
      display: flex;
      align-items: center;
      padding: 0 20px;
      cursor: pointer;
      color: #303133;
      &.active {
        border: 1px solid #1890ff;
        box-shadow: 0 0 6px rgba(6, 58, 108, 0.26);
        .icon-checked {
          display: block;
        }
      }
      .user-avatar {
        margin-right: 20px;
      }
      .user-name {
        line-height: 24px;
        font-size: 14px;
      }
      .user-organize {
        width: 330px;
        line-height: 24px;
        font-size: 12px;
        color: #999999;
        overflow: hidden;
        text-overflow: ellipsis;
        white-space: nowrap;
        word-break: break-all;
      }
      .icon-checked {
        display: none;
        width: 20px;
        height: 20px;
        border: 20px solid #1890ff;
        border-left: 20px solid transparent;
        border-top: 20px solid transparent;
        border-bottom-right-radius: 2px;
        position: absolute;
        transform: scale(0.9);
        right: -2px;
        bottom: -2px;
        i {
          position: absolute;
          top: -2px;
          left: -3px;
          font-size: 20px;
          color: #fff;
        }
      }
    }
  }
}
